import React, { useState } from 'react';

function App() {
  const [msg, setMsg] = useState('');

  const send = (e) => {
    e.preventDefault();
    console.log(msg);
    setMsg('');
  };

  return (
    <div className="App">
      <h1>Chat program using Socket.io</h1>
      <form onSubmit={send}>
        <input
          type="text"
          placeholder="Message here..."
          value={msg}
          onChange={(e) => setMsg(e.target.value)}
        />
        <button type="submit">Send</button>
      </form>
    </div>
  );
}

export default App;
